import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import "./App.css";

// Import components from original locations (not from components subfolder)
import AshaWorkerLogin from "./AshaWorkerLogin";
import AshaWorkerSignup from "./AshaWorkerSignup";
import AshaWorkerDashboard from "./AshaWorkerDashboard";
import Navbar from "./Navbar";
import Home from "./Home";
import Login from "./Login";
import Signup from "./Signup";
import Chatbot from "./Chatbot";
import Prescription from "./Prescription";
import CameraTester from "./CameraTester";

function App() {
  return (
    <Router>
      <div className="app-container">
        <Navbar />
        <div className="content">
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/asha-login" element={<AshaWorkerLogin />} />
            <Route path="/asha-signup" element={<AshaWorkerSignup />} />
            <Route path="/asha-dashboard" element={<AshaWorkerDashboard />} />
            <Route path="/login" element={<Login />} />
            <Route path="/signup" element={<Signup />} />
            <Route path="/chatbot" element={<Chatbot />} />
            <Route path="/prescription" element={<Prescription />} />
            <Route path="/camera-test" element={<CameraTester />} />
          </Routes>
        </div>
      </div>
    </Router>
  );
}

export default App;
